1515940711873.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515940761525.jpg','','',NULL,NULL,NULL,NULL),(336,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515943448146.jpg','来到泰姬陵（Taj Mahal ）印度知名度最高的古迹之一，世界文化遗产，被评选为“世界新七大奇迹”。一座白色大理石建成的巨大陵墓清真寺，是莫卧儿皇帝沙贾汗为纪念他心爱的妃子于1631年至1653年在阿格拉而建的。位于今印度距新德里200多公里外的北方邦的阿格拉(Agra)城内，亚穆纳河右侧。由殿堂、钟楼、尖塔、水池等构成，全部用纯白色大理石建筑，用玻璃、玛瑙镶嵌，具有极高的艺术价值。泰姬陵是印度穆斯林艺术最完美的瑰宝，是世界遗产中的经典杰作之一，被誉为“完美建筑”，又有“印度明珠”的美誉。泰姬陵因爱情而生，这段爱情的生命也因泰姬陵的光彩被续写，光阴轮回，生生不息。尽管有人说，沙贾汗只是一个好大喜功的暴君，根本不是多情种子；尽管有人说，泰姬陵美轮美奂的脚下，不知堆砌着多少人的鲜血乃至生命。但是我们似乎更愿意相信这世上真的有情深意重的男子，有穿越时空的思恋，有生死相随的爱情。泰姬陵依然超越着简单的建筑学意义，默默地美丽着，不为别的，只为世人心中那一点对爱情的美好向往.  【有图旅行】','中国',21,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515943448146.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515943448146.jpg','2018-01-14 17:35:49','2018-01-14 17:35:49',1,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515943514725.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515943567566.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515943739384.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515943801601.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515943866093.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515943986284.jpg','',NULL,NULL,NULL,NULL),(337,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515946661789.jpg','印度的首都.  世界上污染最严重城市之一, 世界上强奸率最高的城市之一, 世界上交通最拥堵的城市之一.  只在这里停留了几天. 这座城市的古建筑给了我太多震撼.  城市被分为了两个部分的现状. 真实的体现了在这座城市生活的人们. 新城区有高楼大厦, 高档社区, 高档消费场所, 没有那么拥堵的车道, 没有到处可见的动物和粪便, 也没有到处踩着单车的黄包车司机.  而老城区, 到处可见的垃圾, 到处的动物粪便, 拥挤的交通, 到处无家可归孩子和流浪人. 真是一个天一个地. 晚上这座城市很快就进入沉浸. 夜晚的马路很多地方都没有路灯. 出于安全考虑. 8点钟以后就不再离开酒店.','中国',21,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515946661789.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515946661789.jpg','2018-01-14 17:35:49','2018-01-14 17:35:49',1,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515946725106.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515946781773.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515946853247.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515946943899.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515946964800.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1515946997704.jpg','',NULL,NULL,NULL,NULL),(338,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516028527086.jpg','吴哥窟！12世纪时，吴哥王朝国王苏耶跋摩二世（Suryavarman II）希望在平地兴建一座规模宏伟的石窟寺庙，作为吴哥王朝的国都和国寺。因此举全国之力，花了大约35年建造。它是吴哥古迹中保存得最完好的建筑，以建筑宏伟与浮雕细致闻名于世.  如果你探访吴哥窟, 那么买三天的通票会是一个不错的选择.  嘟嘟车, 酒吧街彻夜嗨翻天. 别墅酒店, 顶级的泳池.','',21,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516028527086.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516028527086.jpg','2018-01-15 23:28:48','2018-01-15 17:35:54',1,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516028577835.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516028635311.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516028710381.jpg','','','','',NULL,NULL,NULL,NULL),(339,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516115729459.jpg','这样的吴哥窟！你来过吗.','',21,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516115729459.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516115729459.jpg','2018-01-16 23:29:01','2018-01-16 17:35:59',1,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516115802757.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516115928680.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516116000407.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516116218324.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516116308973.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516116472163.jpg','',NULL,NULL,NULL,NULL),(340,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516120731722.jpg','金边河畔吹着海风！等着日落. 7 eleven 再买一瓶啤酒. 享受着美好的时光. 惬意惬意','金边',21,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516120731722.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516120731722.jpg','2018-01-17 00:53:42','20