m/images/custom/21/1516263519828.jpg','中国的后花园. 尼泊尔.  如果你是徒步爱好者, 那么这里有世界顶级的徒步路线. 比如: 安南阿普纳山脉.  如果你热爱滑翔伞, 那么博卡拉你一定不会错过.  如果想感受不一样的文化, 那么尼泊尔一定是第一个选择. 如果印度你还不敢去的话.','尼泊尔',21,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516263519828.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516263519828.jpg','2018-01-18 16:26:43','2018-01-18 09:36:07',1,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516263566332.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516263663591.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516263722082.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516263760435.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516263843653.jpg','','',NULL,NULL,NULL,NULL),(347,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516343213009.jpg','从尼印边界驿站Sonauli进入印度. 转转2个小时到达第一站Gorakhpur中转. 天公不作美. 第一天下起大雨, 于是我第一印象的印度更真实了.','Gorakhpur',21,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516343213009.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516343213009.jpg','2018-01-19 15:09:50','2018-01-19 09:36:12',1,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516343318131.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516343510890.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516344101223.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516344157991.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516345189109.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516345448875.jpg','',NULL,NULL,NULL,NULL),(348,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516345808191.jpg','来到圣城 瓦拉纳西.  这就是印度.','瓦拉纳西',21,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516345808191.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516345808191.jpg','2018-01-19 15:21:46','2018-01-19 09:36:12',1,'http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516345969967.jpg','http://o99spo2ev.bkt.clouddn.com/images/custom/21/1516346270389.jpg','http://o99spo2ev.bkt.clouddn.com/ima