INSERT INTO `jk_tuyou` VALUES (2,47,'菲律宾','2016-10-01 00:00:00','2016-09-13 00:00:00','主要行程是 马尼拉 》 杜马盖地 》 Obslob 》 Siquilar Island. 行程安排的比较轻松，然后主要玩就是潜水，看海豚，乌龟，鲸鲨. 同样行程的图友们，就加我微信吧. shawnhenry123-yao',NULL,NULL,NULL,NULL,NULL,1,'2016-09-21 17:11:52','2016-09-21 17:11:52'),(7,21,'中国','2016-10-18 00:00:00','2016-10-06 00:00:00','计划十月去西藏，沿途经过武汉 － 成都 － 昆明 － 大理 － 丽江 － 香格里拉 － 灵芝地区 － 西藏 － 日喀则 然后回到拉萨飞回上海. 有同样计划的图友，联系我吧.  475673272 加我qq联系.',NULL,NULL,NULL,NULL,NULL,1,'2016-09-22 18:05:42','2016-09-22 18:05:42'),(9,49,'马来西亚','2016-11-01 00:00:00','2016-11-15 00:00:00','停留2个星期，走访吉隆坡， 马六甲， 中国城这些地方。有要去地方的小伙伴吗，有就联系我吧，加我qq吧. 475673272.',NULL,NULL,NULL,NULL,NULL,1,'2016-09-24 10:05:47','2016-09-24 10:05:47');
